    [],nt"revision_timestamp": "2015-05-07T03:31:32.625999",nt"name": "multi-layered-integrated-airframe-system-project-c9495",nt"isopen":
    true,nt"url": null,nt"notes": "This proposed Phase II program builds on
    the Phase I effort addressing NASA's future mission requirements by: 1) developing
    higher performing TPS materials capable of meeting the demands of multiple severe
    mission trajectories; and 2) integrating TPS materials with the sub-structure to
    improve overall robustness and decrease mass.  The program's goal is to extend Phenolic
    Impregnated Carbon Ablator (PICA) and Fiber Materials, Inc. (FMI&lt;SUP&gt;REG&lt;/SUP&gt;)
    Integrated Composite Structure (ICS) TPS materials to a broader range of flight
    heat fluxes and mission performance requirements to address future heatshield design
    needs.  Specific mission enabling improvements sought by NASA that will be developed
    and/or demonstrated under this Phase II program include: preform/component size,
    ablation performance, thermal insulation performance, efficient and extendable assembly
    process, and net-shape preform casting.",nt"license_title": "U.S. Government
